var options ={
  sorted: false,
  filtered:false,
};

var MAX_ANNUAL_CONTRACT_REVENUE = 890000000000;

var tbody =d3.select("tbody");

function updateTable(){
  tbody.html("");

  var rows = tbody.selectAll("tr")
    .data(contracts)
    .enter()
    .append("tr")
    .attr("class","bar")

  rows.append("td")
    .html(function(d) {return d.Agency});

  rows.append("td")
    .html(function(d) {return d.Annual_Contract_Revenue});

  rows.append("td")
    .html(function(d) {return d.State});

  rows.append("td")
    .html(function(d) {return d.Country});

  rows.append("td")
    .html(function(d) {return d.Congressional_District});

  rows.append("td")
    .html(function(d) {return d.Contracting_Agency});

  rows.append("td")
    .html(function(d) {return d.Contracting_Office});

  rows.append("td")
    .html(function(d) {return d.DUNS});

  rows.append("td")
    .html(function(d) {return d.Contract_Date});

  rows.append("td")
    .html(function(d) {return d.Vendor});

  rows.append("td")
    .append ("div")
    .classed("bar", true)
    .style ("width", function(d) {return ((d.Annual_Contract_Revenue/ MAX_ANNUAL_CONTRACT_REVENUE)*100) + "%"}) 
};

updateTable();

  .on("click", function(){
    d3.select('#sort-asc').classed('active',false);
    d3.select('#sort-desc').classed('active', true);
  });
updateTable();

.on ('click', function(){
  if (options.sorted === 'asc') {
    options.sorted = false;
  d3.select('#sort-desc').classed('active',false);
  } else {
    options.sorted = 'asc';
  d3.select('#sort-asc').classed('active', true);
  }
  updateTable();
  });

d3.select("#sort-desc")
.on ('click', function(){
  if (options.sorted === 'desc') {
    options.sorted = false;
  } else {
    options.sorted = 'desc';
  }
  updateTable();
  });


d3.select("filter-MARYLAND")
  .on("click", function(){
  if(options.filtered==="MARYLAND"){
    options.filtered=false;
  d3.select("#filter-MARYLAND")
    .classed("active",false)
  }else{
    options.filtered="MARYLAND";
   d3.select("#filter-MARYLAND")
    .classed("active",true);
  }
  updateTable();
});

d3.select("#filter-VIRGINA").classed("active",true)
d3.select("filter-VIRGINIA")
  .on("click", function(){
  if(options.filtered==="VIRGINIA"){
    options.filtered=false;
  }else{
    options.filtered="VIRGINIA";
  }
  updateTable();
});

d3.select("#filter-CALIFORNIA").classed("active",true)
d3.select("filter-CALIFORNIA")
  .on("click", function(){
  if(options.filtered==="CALIFORNIA"){
    options.filtered=false;
  }else{
    options.filtered="CALIFORNIA";
  }
  updateTable();
});

</script>
